        public static async Task<bool> SendEmailAsync(string email, string? subject, string? plainBody, string? htmlBody = null, List<string> attachments = null)
        {
            try
            {
                if (string.IsNullOrWhiteSpace(htmlBody) && string.IsNullOrWhiteSpace(plainBody))
                {
                    throw new NullReferenceException("Message for body is required.");
                }


                if (!validateEmailString(email))
                {
                    throw new InvalidDataException("Email is not valid.");

                }
                using (var client = new SmtpClient())
                {
                    var credential = new System.Net.NetworkCredential
                    {
                        UserName = AppConstants.EmailUserName,
                        Password = AppConstants.EmailPassword
                    };

                    client.Credentials = credential;
                    client.Host = AppConstants.EmailHost;
                    client.Port = AppConstants.EmailPort;
                    client.EnableSsl = true;

                    using (var emailMessage = new MailMessage())
                    {
                        emailMessage.To.Add(new MailAddress(email));
                        emailMessage.From = new MailAddress(AppConstants.EmailUserName);
                        emailMessage.Subject = subject;

                        if (attachments != null && attachments.Count > 0)
                        {
                            foreach (var path in attachments)
                            {
                                if (File.Exists(path))
                                {
                                    emailMessage.Attachments.Add(new Attachment(path));
                                }
                            }

                        }

                        if (!string.IsNullOrEmpty(plainBody))
                        {
                            emailMessage.AlternateViews.Add(AlternateView.CreateAlternateViewFromString(plainBody, null, MediaTypeNames.Text.Plain));
                        }


                        if (!string.IsNullOrEmpty(htmlBody))
                        {
                            emailMessage.AlternateViews.Add(AlternateView.CreateAlternateViewFromString(htmlBody, null, MediaTypeNames.Text.Html));
                        }


                        client.Send(emailMessage);
                    }
                }

                await Task.CompletedTask;

                return true;
            }
            catch
            {
                return false;
            }
        }

        static bool validateEmailString(string email)
        {
            if (string.IsNullOrWhiteSpace(email))
                return false;

            try
            {
                // Normalize the domain
                email = Regex.Replace(email, @"(@)(.+)$", DomainMapper,
                                      RegexOptions.None, TimeSpan.FromMilliseconds(200));

                // Examines the domain part of the email and normalizes it.
                string? DomainMapper(Match match)
                {
                    // Use IdnMapping class to convert Unicode domain names.
                    var idn = new System.Globalization.IdnMapping();

                    // Pull out and process domain name (throws ArgumentException on invalid)
                    var domainName = idn.GetAscii(match.Groups[2].Value);

                    return match.Groups[1].Value + domainName;
                }
            }
            catch (RegexMatchTimeoutException e)
            {
                return false;
            }
            catch (ArgumentException e)
            {
                return false;
            }

            try
            {
                return Regex.IsMatch(email,
                    @"^(?("")("".+?(?<!\\)""@)|(([0-9a-z]((\.(?!\.))|[-!#\$%&'\*\+/=\?\^`\{\}\|~\w])*)(?<=[0-9a-z])@))" +
                    @"(?(\[)(\[(\d{1,3}\.){3}\d{1,3}\])|(([0-9a-z][-0-9a-z]*[0-9a-z]*\.)+[a-z0-9][\-a-z0-9]{0,22}[a-z0-9]))$",
                    RegexOptions.IgnoreCase, TimeSpan.FromMilliseconds(250));
            }
            catch (RegexMatchTimeoutException)
            {
                return false;
            }
        }

